import styled from "styled-components";
import React from "react";

const Container = styled.div.attrs({ className: "flex items-center" })`
  margin-left: auto;
  margin-right: auto;
  width: 100%;

  @media (min-width: 1020px) {
    max-width: 1684px;
    padding-left: 122px;
    padding-right: 122px;
  }

  @media (min-width: 620px) {
    max-width: 1600px;
    padding-left: 80px;
    padding-right: 80px;
  }
`;

const HeaderLogo = () => (
  <Container>
    <a href="/en-ca/" className="flex-grow-10">
      <picture>
        <source
          className="block w-4"
          media="(min-width: 600px)"
          srcSet="/images/header-logo.svg"
        />
        <img
          className="block p-4"
          src="/images/header-logo-small.svg"
          alt="IfItDoesntMatchAnyMedia"
        />
      </picture>
    </a>
  </Container>
);
export default HeaderLogo;
